import React from 'react';
import './OptionCard.css';

const OptionCard = ({ option, onSelect, isSelected }) => {
  return (
    <div className={`option-card ${isSelected ? 'selected' : ''}`} onClick={() => onSelect(option)}>
      <div className="option-background" style={{ backgroundImage: `url(${option.image})` }}>
        <div className="option-text">{option.text}</div>
      </div>
    </div>
  );
};

export default OptionCard;
